// src/App.js
import React from 'react';
import './m.css';

// Match Component
const Match = ({ team1, team2, date, time }) => {
  return (
    <div className="match">
      <h3>{team1} vs {team2}</h3>
      <p>Date: {date}</p>
      <p>Time: {time}</p>
    </div>
  );
};

// MatchesList Component
const MatchesList = ({ matches }) => {
  return (
    <div className="matches-list">
      {matches.map((match, index) => (
        <Match
          key={index}
          team1={match.team1}
          team2={match.team2}
          date={match.date}
          time={match.time}
        />
      ))}
    </div>
  );
};

// Main App Component
const Matches = () => {
  const matches = [
    { team1: 'Team A', team2: 'Team B', date: '2023-10-01', time: '15:00' },
    { team1: 'Team C', team2: 'Team D', date: '2023-10-02', time: '18:00' },
    { team1: 'Team E', team2: 'Team F', date: '2023-10-03', time: '20:00' },
  ];

  return (
    <div className="App">
      <h1>Upcoming Matches</h1>
      <MatchesList matches={matches} />
    </div>
  );
};

export default Matches;
